(function(Timeline){
	"use strict";
	
	if(!Timeline){
		throw new Error("Timeline Uninitialized");
	}
	
	function makeSegFont(params, defaults){
		var font = {
			textStyle: params.textStyle || defaults.textStyle,
			textSize: params.textSize || defaults.textSize,
			textFace: params.textFace || defaults.textFace,
			textColor: params.textColor || defaults.textColor,
			idStyle: params.idStyle || defaults.idStyle,
			idSize: params.idSize || defaults.idSize,
			idFace: params.idFace || defaults.idFace,
			idColor: params.idColor || defaults.idColor
		};
		font.textFont = font.textStyle+" "+font.textSize+"px "+font.textFace;
		font.idFont = font.idStyle+" "+font.idSize+"px "+font.idFace;
		return Object.freeze(font);
	}
	
	function Fonts(obj){
		var key, title;
	
		//Key timecode font
		key = {
			style: obj.keyFontStyle || "italic",
			size: obj.keyFontSize || 14,
			face: obj.keyFontFace || "sans-serif",
			color: obj.keyFontColor || "#fff"
		};
		key.font = key.style+" "+key.size+"px "+key.face;
		this.key = Object.freeze(key);
		
		//Track title font
		title = {
			style: obj.titleFontStyle || "italic",
			size: obj.titleFontSize || 14,
			face: obj.titleFontFace || "sans-serif",
			color: obj.titleTextColor || "#ddd"
		};
		title.font = title.style+" "+title.size+"px "+title.face;
		this.title = Object.freeze(title);
		
		//Subtitle track cue fonts
		this.subtitles = makeSegFont(obj.subtitles||{},{
			textStyle: "", textSize: 20, textFace: "sans-serif", textColor: "#000",
			idStyle: "italic", idSize: 10, idFace: "sans-serif", idColor: "#bbb"
		});
		
		//Caption track cue fonts
		this.captions = makeSegFont(obj.captions||{},{
			textStyle: "", textSize: 20, textFace: "sans-serif", textColor: "#000",
			idStyle: "italic", idSize: 10, idFace: "sans-serif", idColor: "#bbb"
		});
		
		//Description track cue fonts
		this.descriptions = makeSegFont(obj.descriptions||{},{
			textStyle: "italic", textSize: 20, textFace: "sans-serif", textColor: "#aaa",
			idStyle: "italic", idSize: 10, idFace: "sans-serif", idColor: "#bbb"
		});
		
		//Chapter track cue fonts
		this.chapters = makeSegFont(obj.chapters||{},{
			textStyle: "", textSize: 20, textFace: "sans-serif", textColor: "#000",
			idStyle: "italic", idSize: 10, idFace: "sans-serif", idColor: "#bbb"
		});
		
		//Metadata track cue fonts
		this.metadata = makeSegFont(obj.metadata||{},{
			textStyle: "", textSize: 20, textFace: "Courier", textColor: "#000",
			idStyle: "", idSize: 10, idFace: "sans-serif", idColor: "#bbb"
		});
		
		Object.freeze(this);
	}
	
	Timeline.Fonts = Fonts;
	
	function Colors(obj){
		this.bgMid = obj.bgMid || "#3e3f43";
		this.bgTop = obj.bgTop || "#292a2d";
		this.bgBottom = obj.bgBottom || "#292a2d";
		this.placeholder = obj.placeholder || "rgba(255, 255, 160, 0.5)";
		this.timeMarker = obj.timeMarker || "rgba(255, 255, 160, 0.5)";
		this.abRepeat = obj.abRepeat || "rgba(255, 0, 0, 0.4)";
		this.abRepeatLight = obj.abRepeatLight || "rgba(255, 0, 0, 0.25)";
		this.selectBox = obj.selectBox || "rgba(0, 119, 236, 0.25)";
		this.selectBorder = obj.selectBorder || "rgba(0, 128, 255, 0.25)";
		this.autoCueBorder = obj.autoCueBorder || "rgba(0, 128, 255, 0.75)";
		this.autoFillBorder = obj.autoFillBorder || "rgba(64, 255, 64, 0.75)";
		this.tintSaved = obj.tintSaved || "rgba(0, 100, 155, 0.1)";
		this.tintUnsaved = obj.tintUnsaved || "rgba(222, 33, 116, 0.15)";
		Object.freeze(this);
	}
	
	Timeline.Colors = Colors;
	
	function genImage(url){
		var img = new Image;
		img.src = url;
		return img;
	}
	
	var defaultBg = genImage("data:image/png;base64,");
	var defaultImages = {
		segment: { // default images
			background: defaultBg,
			left: genImage("data:image/png;base64,"),
			right: genImage("data:image/png;base64,"),
			mid: genImage("data:image/png;base64,")
		},
		captions: {
			background: defaultBg,
			left: genImage("data:image/png;base64,"),
			right: genImage("data:image/png;base64,"),
			mid: genImage("data:image/png;base64,")
		},
		descriptions: {
			background: defaultBg,
			left: genImage("data:image/png;base64,"),
			right: genImage("data:image/png;base64,"),
			mid: genImage("data:image/png;base64,")
		},
		chapters: {
			background: defaultBg,
			left: genImage("data:image/png;base64,"),
			right: genImage("data:image/png;base64,"),
			mid: genImage("data:image/png;base64,")
		},
		metadata: {
			background: defaultBg,
			left: genImage("data:image/png;base64,"),
			right: genImage("data:image/png;base64,"),
			mid: genImage("data:image/png;base64,")
		},
		dark: { // dark images
			background: defaultBg,
			left: genImage("data:image/png;base64,"),
			right: genImage("data:image/png;base64,"),
			mid: genImage("data:image/png;base64,")
		},
		selected: { // selected images
			left: genImage("data:image/png;base64,"),
			right: genImage("data:image/png;base64,"),
			mid: genImage("data:image/png;base64,")
		},
		slider: { // slider images
			left: genImage("data:image/png;base64,"),
			right: genImage("data:image/png;base64,"),
			mid: genImage("data:image/png;base64,")
		}
	};

	function Images(obj){
		var def_imgs, obj_imgs, oname, iname, imgs;
		for(oname in defaultImages){
			def_imgs = defaultImages[oname];
			obj_imgs = obj[oname];
			if(obj_imgs instanceof Object){
				imgs = {};
				for(iname in imgs){
					imgs[iname] = (obj_imgs[iname] instanceof Image)?obj_imgs[iname]:def_imgs[iname];
				} 
			}else{
				imgs = def_imgs;
			}
			this[oname] = imgs;
		}
	}
	
	Object.defineProperty(Images.prototype,'complete',{
		get: function(){
			if(!Object.keys(this).every(function(set_key){
				var iname, iset = this[set_key];
				for(iname in iset){ if(!iset[iname].complete){ return false; } }
				return true;
			},this)){ return false; }
			Object.defineProperty(this,'complete',{value:true});
			Object.freeze(this);
			return true;
		},enumerable:true
	});
	
	Timeline.Images = Images;
	
	function Cursors(obj){
		this.pointer = obj.pointer || "url(\"data:image/png;base64,\"), auto";
		this.order = obj.order || "url(\"data:image/png;base64,\") 15 15, ns-resize";
		this.resizeR = obj.resizeR || "url(\"data:image/png;base64,\") 10 15, col-resize";
		this.resizeL = obj.resizeL || "url(\"data:image/png;base64,\") 22 15, col-resize";
		this.move = obj.move || "url(\"data:image/png;base64,\") 15 15, ew-resize";
		this.skip = obj.skip || "url(\"data:image/png;base64,\") 1 5, auto";
		this.repeatA = obj.repeatA || "url(\"data:image/png;base64,\"), auto";
		this.repeatB = obj.repeatB || "url(\"data:image/png;base64,\"), auto";
		this.add = obj.add || "url(\"data:image/png;base64,\"), auto";
		this.select = obj.select || "url(\"data:image/png;base64,\"), auto";
		this.remove = obj.remove || "url(\"data:image/png;base64,\") 15 15, pointer";
		this.split = obj.split || "url(\"data:image/png;base64,\") 3 10, pointer";
		this.locked = obj.locked || "not-allowed";
		Object.freeze(this);
	}
	
	Timeline.Cursors = Cursors;
}(Timeline));